    const AddData=(event)=>{

        console.log(event.target.value);
        event.preventDefault();
    }

    return (        
            <form onSubmit={AddData}>
                <label>Username</label>
                <input type="text" />
                <label>Age</label>
                <input type="text" />                
                <Button type="submit" name={"Add"}/>
            </form>            
    );
}

export default Input;
